						["custom"] = "function(_, message)\n    if message == nil or not message:find(\"^FAKE_LOOT_TEST\") then\n        return\n    end\n    print(\"Sending FAKE_LOOTs\")\n    local FakeLootFromLink = function(itemLink)\n        print(\"Sending FAKE_LOOT \"..itemLink)\n        WeakAuras.ScanEvents(\"FAKE_LOOT\", \"You receive loot: \"..itemLink)\n    end\n    local FakeLoot = function(itemId)\n        local itemLink = select(2, GetItemInfo(itemId))\n        if (itemLink == nil) then\n            print(\"Failed to send FAKE_LOOT \"..itemId)\n        else\n            FakeLootFromLink(itemLink)\n        end\n    end\n    --FakeLoot(146666) -- [Celumbra, the Night's Dichotomy], Cloth Shoulders, Class: Priest, Mage, Warlock\n    --FakeLoot(147108) -- [Brand of Relentless Agony], Shadow Relic\n    --FakeLoot(147084) -- [Imploding Infernal Star], Fel Relic\n    --FakeLoot(132444) -- [Prydaz, Xavaric's Magnum Opus] Neck\n    --FakeLoot(144438) -- [Zeks Exterminatus] Back\n    --FakeLoot(144259) -- [Kil'jaeden's Burning Wish] Trinket\n    --local ringWithSocket = \"|cffa335ee|Hitem:134525::130216::::::110:258::23:4:1727:1808:1517:3528:::|h[Seal of the Nazjatar Empire]|h|r\"\n    --FakeLootFromLink(ringWithSocket)\n    FakeLoot(147167) -- [Robes of Blind Absolution], Cloth Chest, Class: Priest\n    --FakeLoot(147133) -- [Stormheart Tunic], Lether Chest, Class: Druid    \n    FakeLoot(147149) -- [Robes of the Arcane Tempest], Cloth Chest, Class: Mage\n    return false\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
