				["custom"] = "-- text\n-- You receive item: [Blacksmith Hammer]x2.\nfunction(event, textOrItemId)\n    \n    -- Debugging methods\n    local loggingEnabled = event == \"FAKE_LOOT\" --or true\n    local Map = function(array, f) \n        local result = {}\n        for i = 1, #array do\n            result[i] = f(array[i])\n        end\n        return result\n    end\n    local First = function(array, predicate)\n        for key = 1, #array do\n            local value = array[key]\n            local found = predicate(value, key)\n            if found then\n                return value, key\n            end\n        end \n        return nil\n    end\n    local Append = function(array, value)\n        array[#array+1] = value            \n        return array\n    end\n    local ToString = function(message, ...) \n        if (... == nil) then\n            return string.format(message, \"nil\") \n        end\n        return string.format(message, unpack(Map({...}, tostring)))\n    end\n    local Log = function(message, ...)\n        if loggingEnabled then\n            local prefix = \"|cffffd200ILA:|r \"\n            print(prefix..ToString(message, ...))\n        end\n    end\n    local Space = function(n) return string.rep(' ', n) end\n    local KeyToString = function(key)\n        local type = type(key)\n        if type == \"string\" then\n            return \"[\\\"\"..key..\"\\\"]\"\n        end\n        if type == \"table\" or type == \"function\" then\n            return \"[<\"..tostring(key)..\">]\"\n        end\n        return \"[\"..tostring(key)..\"]\"            \n    end\n    local DumpRecurser = nil\n    DumpRecurser = function(key, value, level, visited, accumulator)\n        if level > 10 then\n            return accumulator\n        end\n        local valueType = type(value)\n        if valueType == nil or valueType == \"boolean\" or valueType == \"number\" then\n            Append(accumulator, ToString(\"%s\", value))\n        end\n        if valueType == \"string\" then\n            Append(accumulator, ToString(\"\\\"%s\\\"\", value))\n        end\n        if valueType == \"function\" then\n            Append(accumulator, string.format(\"<%s>\", tostring(value)))\n        end\n        if valueType == \"table\" then\n            if visited[value] then\n                Append(accumulator, string.format(\"%s%s=#%s\\n\", Space(level), KeyToString(key), tostring(value)))\n            else\n                visited[value] = true\n                for childKey, childValue in pairs(value) do\n                    local childValueIsTable = type(childValue) == \"table\"\n                    if childValueIsTable then\n                        if visited[childValue] then\n                            Append(accumulator, string.format(\"%s%s=<%s>\\n\", Space(level), KeyToString(childKey), tostring(childValue)))\n                        else\n                            Append(accumulator, string.format(\"%s%s<%s>={\\n\", Space(level), KeyToString(childKey), tostring(childValue)))\n                            DumpRecurser(childKey, childValue, level + 1, visited, accumulator)\n                            Append(accumulator, string.format(\"%s}\\n\", Space(level)))\n                        end\n                    else\n                        Append(accumulator, string.format(\"%s%s=\", Space(level), KeyToString(childKey)))\n                        DumpRecurser(childKey, childValue, level + 1, visited, accumulator)\n                        Append(accumulator, \"\\n\")\n                    end\n                end\n            end\n            \n        end\n        return accumulator\n    end\n    local Dump = function(key, value) \n        local accumulator = {}\n        local valueIsTable = type(value) == \"table\"\n        if valueIsTable then\n            Append(accumulator, ToString(\"\\n%s<%s>={\\n\", KeyToString(key), tostring(value)))\n            DumpRecurser(key, value, 1, {}, accumulator)            \n            Append(accumulator, \"}\")\n        else\n            Append(accumulator, ToString(\"%s=\", KeyToString(key)))\n            DumpRecurser(key, value, 1, {}, accumulator)            \n        end\n        return Log(table.concat(accumulator))\n    end\n    \n    -- Helper methods\n    local IsArtifactRelic = function(itemId)\n        return select(7, GetItemInfo(itemId)) == \"Artifact Relic\"\n    end\n    local IsArmor = function(itemId)\n        return select(6, GetItemInfo(itemId)) == \"Armor\"\n    end\n    local GetArtifactRelicType = function(itemId)\n        return select(3, C_ArtifactUI.GetRelicInfoByItemID(itemId))\n    end\n    local GetArmorType = function(itemId)\n        return select(7, GetItemInfo(itemId))\n    end\n    local GetItemType = function(itemId)\n        if IsArtifactRelic(itemId) then\n            -- E.g. Shadow Artifact Relic\n            return GetArtifactRelicType(itemId):gsub(\"Wind\", \"Storm\")..\" Artifact Relic\"\n        else\n            -- E.g. Main Hand\n            return _G[select(9, GetItemInfo(itemId))]\n        end\n    end\n    local GetArtifactRelicTypesByClass = function(class)\n        local db = {\n            [\"DEMONHUNTER\"] = { [\"Fel\"] = 1, [\"Shadow\"] = 1, [\"Iron\"] = 1, [\"Arcane\"] = 1 },\n            [\"DEATHKNIGHT\"] = { [\"Blood\"] = 1, [\"Shadow\"] = 1, [\"Iron\"] = 1, [\"Frost\"] = 1, [\"Fire\"] = 1 },\n            [\"DRUID\"] = { [\"Arcane\"] = 1, [\"Life\"] = 1, [\"Frost\"] = 1, [\"Blood\"] = 1, [\"Fire\"] = 1 },\n            [\"HUNTER\"] = { [\"Wind\"] = 1, [\"Arcane\"] = 1, [\"Iron\"] = 1, [\"Blood\"] = 1, [\"Life\"] = 1 },\n            [\"MAGE\"] = { [\"Arcane\"] = 1, [\"Frost\"] = 1, [\"Fire\"] = 1 },\n            [\"MONK\"] = { [\"Life\"] = 1, [\"Wind\"] = 1, [\"Iron\"] = 1, [\"Frost\"] = 1 },\n            [\"PALADIN\"] = { [\"Holy\"] = 1, [\"Life\"] = 1, [\"Iron\"] = 1, [\"Arcane\"] = 1, [\"Fire\"] = 1 },\n            [\"PRIEST\"] = { [\"Holy\"] = 1, [\"Shadow\"] = 1, [\"Life\"] = 1, [\"Blood\"] = 1 },\n            [\"ROGUE\"] = { [\"Shadow\"] = 1, [\"Iron\"] = 1, [\"Blood\"] = 1, [\"Wind\"] = 1, [\"Fel\"] = 1 },\n            [\"SHAMAN\"] = { [\"Wind\"] = 1, [\"Frost\"] = 1, [\"Fire\"] = 1, [\"Iron\"] = 1, [\"Life\"] = 1 },\n            [\"WARLOCK\"] = { [\"Shadow\"] = 1, [\"Blood\"] = 1, [\"Fire\"] = 1, [\"Fel\"] = 1 } ,\n            [\"WARRIOR\"] = { [\"Iron\"] = 1, [\"Blood\"] = 1, [\"Shadow\"] = 1, [\"Fire\"] = 1, [\"Wind\"] = 1 }\n        }\n        local relicTypes = db[class]\n        Dump(\"relicTypes\", relicTypes)\n        return relicTypes\n    end\n    local GetArmorTypeByClass = function(class)\n        local db = {\n            [\"DEMONHUNTER\"] = \"Leather\",\n            [\"DEATHKNIGHT\"] = \"Plate\",\n            [\"DRUID\"] = \"Leather\",\n            [\"HUNTER\"] = \"Mail\",\n            [\"MAGE\"] = \"Cloth\",\n            [\"MONK\"] = \"Leather\",\n            [\"PALADIN\"] = \"Plate\",\n            [\"PRIEST\"] = \"Cloth\",\n            [\"ROGUE\"] = \"Leather\",\n            [\"SHAMAN\"] = \"Mail\",\n            [\"WARLOCK\"] = \"Cloth\",\n            [\"WARRIOR\"] = \"Plate\"\n        }\n        local armorType = db[class]\n        Dump(\"armorType\", armorType)\n        return db[class]\n    end\n    local GetPlayerClass = function() \n        return select(2, UnitClass(\"player\"))\n    end\n    local IsInterestingArtifactRelic = function(itemId) \n        if not IsArtifactRelic(itemId) then \n            Log(\"IsArtifactRelic(%s)=false\", itemId)\n            return false \n        end\n        local relicType = GetArtifactRelicType(itemId)\n        Dump(\"relicType\", relicType)\n        local class = GetPlayerClass()\n        local isInteresting = GetArtifactRelicTypesByClass(class)[relicType] == 1\n        Log(\"IsInterestingArtifactRelic(%s)=%s\", itemId, isInteresting)\n        return isInteresting\n    end    \n    local IsInterestingArmor = function(itemId)\n        if not IsArmor(itemId) then return false end\n        local type = GetArmorType(itemId)\n        local class = GetPlayerClass()\n        return GetArmorTypeByClass(class) == type\n    end\n    local IsNeck = function(itemId) return _G[select(9, GetItemInfo(itemId))] == \"Neck\" end\n    local IsBack = function(itemId) return _G[select(9, GetItemInfo(itemId))] == \"Back\" end\n    local IsFinger = function(itemId) return _G[select(9, GetItemInfo(itemId))] == \"Finger\" end\n    local IsTrinket = function(itemId) return _G[select(9, GetItemInfo(itemId))] == \"Trinket\" end\n    local IsInterestingNonArmor = function(itemId)\n        return IsNeck(itemId) or IsBack(itemId) or IsFinger(itemId) or IsTrinket(itemId)\n    end\n    local IsLegendary = function(itemId) return select(3, GetItemInfo(itemId)) == 5 end\n    local IsUsableByPlayerClass = function(itemLink) \n        -- Create frame if needed\n        local prefix = \"Ila\"\n        if aura_env.frame == nil then\n            aura_env.frame = CreateFrame(\"GameTooltip\", prefix..\"Tooltip\", UIParent, \"GameTooltipTemplate\") \n        end\n        -- Expected tooltip texts\n        local db = {\n            [\"DEMONHUNTER\"] = \"^Classes: Demon Hunter\",\n            [\"DEATHKNIGHT\"] = \"^Classes: Death Knight\",\n            [\"DRUID\"] = \"^Classes: Druid\",\n            [\"HUNTER\"] = \"^Classes: Hunter\",\n            [\"MAGE\"] = \"^Classes: Mage\",\n            [\"MONK\"] = \"^Classes: Monk\",\n            [\"PALADIN\"] = \"^Classes: Paladin\",\n            [\"PRIEST\"] = \"^Classes: Priest\",\n            [\"ROGUE\"] = \"^Classes: Rogue\",\n            [\"SHAMAN\"] = \"^Classes: Shaman\",\n            [\"WARLOCK\"] = \"^Classes: Warlock\",\n            [\"WARRIOR\"] = \"^Classes: Warrior\"          \n        }\n        local class = GetPlayerClass()\n        local classText = db[class]\n        \n        local f = aura_env.frame\n        f:SetOwner(UIParent, 'ANCHOR_NONE')\n        f:SetHyperlink(itemLink) \n        for i = 1, f:NumLines() do\n            local line = _G[prefix..\"TooltipTextLeft\"..i]:GetText() or \"\"\n            Dump(\"line\", line:gsub(\"%%\", \"%%%%\"))\n            local isClassRestricted = line:find(\"^Classes: \")\n            local isPlayerClassAllowed = line:find(classText)\n            --Dump(\"isPlayerClassAllowed\", isPlayerClassAllowed)\n            --Dump(\"isClassRestricted\", isClassRestricted)\n            if isClassRestricted and not isPlayerClassAllowed then\n                Log(\"Item not usable by class=%s\", class)\n                return false\n            end\n        end\n        f:Hide()\n        return true\n    end\n    local IsInterestingItem = function(itemId, itemLink)\n        return not IsLegendary(itemId) and (IsInterestingArtifactRelic(itemId) or IsInterestingArmor(itemId) or IsInterestingNonArmor(itemId)) and IsUsableByPlayerClass(itemLink)\n    end\n    local GetItemId = function(itemLink) return itemLink:match(\":(%d+):\") end\n    \n    -- Parse message\n    -- Did requested item info become available?\n    Dump(\"event\", event)\n    local text = textOrItemId\n    if event == \"GET_ITEM_INFO_RECEIVED\" then\n        if type(aura_env.unhandled) == \"table\" and aura_env.unhandled[textOrItemId] ~= nil then\n            text = aura_env.unhandled[textOrItemId]\n            aura_env.unhandled[textOrItemId] = nil\n        else\n            Log(\"Aborting! Reason: GET_ITEM_INFO_RECEIVED not requested by us\")\n            return false\n        end\n    end\n    Dump(\"text\", text)\n    if (text == nil) then \n        Log(\"Aborting! Reason: text=nil\")\n        return false \n    end\n    local delimiters = { \" receive item: \", \" receive loot: \", \" receives loot: \" }\n    local delimiterIndex = 0\n    for i = 1, #delimiters + 1 do\n        if i > #delimiters then \n            Log(\"Aborting! Reason: Delimiter not found\")\n            return false \n        end\n        if text:find(delimiters[i]) then\n            delimiterIndex = i\n            break\n        end\n    end\n    local delimiter = delimiters[delimiterIndex]\n    local mangledText = text:gsub(delimiter, \" \") -- Remove delimiter: You [Blacksmith Hammer]x2.\n    local spaceIndex = mangledText:find(\" \")\n    local playerOrYou = mangledText:sub(1, spaceIndex - 1)\n    local player = playerOrYou == \"You\" and UnitName(\"player\") or playerOrYou\n    local itemLinkish = mangledText:sub(spaceIndex + 1) -- Linkish because it might have trailing crap e.g. \"x2.\"\n    local itemId = GetItemId(itemLinkish)\n    local itemLink = select(2, GetItemInfo(itemLinkish))  -- Luckily GetItemInfo seems to handle trailing crap.\n    local AddPending = function(itemId, text)\n        if aura_env.unhandled == nil then\n            aura_env.unhandled = {}\n        end\n        aura_env.unhandled[itemId] = text\n    end\n    if itemLink == nil then\n        Log(\"Aborting! Reason: itemLink=nil\")\n        AddPending(itemId, text)\n        return false\n    end\n    Dump(\"player\", player)\n    Dump(\"itemLink\", itemLink)\n    \n    \n    -- Get item info\n    if not IsInterestingItem(itemId, itemLink) then\n        Log(\"Uninteresting item: %s\", text)\n        return false\n    end\n    local itemLevel = select(4, GetItemInfo(itemLink))\n    local itemType = GetItemType(itemId)\n    \n    -- Not sure if this can happen, probably can, better safe than sorry\n    if (itemType == nil) then\n        print(\"Failed to handle item message: \"..text)\n        return false\n    end\n    \n    -- Create player link\n    -- Stolen from ItemRef.lua\n    local GetPlayerLink = function(player)\n        local linkType = \"player\"\n        local linkDisplayText = player\n        local linkFormatTable = { (\"|H%s\"):format(linkType), linkDisplayText };\n        local formattedLink = table.concat(linkFormatTable, \":\") .. (\"|h%s|h\"):format(linkDisplayText);\n        local class, classFileName = UnitClass(player)\n        local classColorRgb = RAID_CLASS_COLORS[classFileName]\n        local GetColor = function(c) return string.format(\"|cff%02x%02x%02x\", c.r*255, c.g*255, c.b*255) end\n        local classColor = GetColor(classColorRgb)\n        return \"[\"..classColor..formattedLink..\"|r]\"\n    end\n    \n    -- Function to calculate item level diff between looted and equipped\n    local GetLowestEquippedItemLevelOfItemType = function(itemType)\n        local slots = {}\n        if itemType == \"Trinket\" or itemType == \"Finger\" then\n            slots[1] = (itemType..\"0Slot\"):gsub(\" \", \"\")\n            slots[2] = (itemType..\"1Slot\"):gsub(\" \", \"\")\n        elseif itemType:find(\"Artifact Relic\") then\n            -- TODO: Handle artifact relics            \n            return 99999\n        else\n            slots[1] = (itemType..\"Slot\"):gsub(\" \", \"\")\n        end\n        \n        local slotItemLevelMin = math.huge\n        for _, slot in ipairs(slots) do\n            Dump(\"slot\", slot)\n            local slotId = GetInventorySlotInfo(slot)\n            Dump(\"slotId\", slotId)\n            local slotItemLink = GetInventoryItemLink(\"player\", slotId) -- Returns nil if not equipped\n            Dump(\"slotItemLink\", slotItemLink)\n            slotItemLevel = slotItemLink == nil and 0 or select(4, GetItemInfo(slotItemLink))\n            if slotItemLevel == nil then\n                local itemId = GetItemId(slotItemLink)\n                Log(\"Warning! Item with itemId=%s in slot=%s was not found in cache\", itemId, slot)\n                return nil, itemId\n            end\n            slotItemLevelMin = min(slotItemLevel, slotItemLevelMin)\n        end\n        return slotItemLevelMin\n    end\n    \n    local lowest, nonCachedItemId = GetLowestEquippedItemLevelOfItemType(itemType)\n    if lowest == nil then\n        Log(\"Aborting! Reason: Could not get lowest item level equipped for item type\")\n        AddPending(nonCachedItemId, text)\n        return false\n    end\n    local relic = 99999\n    local diff = lowest == relic and 0 or itemLevel - lowest\n    local diffText = lowest == relic and \"???\" or diff\n    local diffColor = (diff < 0 and \"|cffff2020\") or (diff > 0 and \"|cff20ff20\") or \"|cffffd200\"\n    local diffSign = (diff < 0 and \"\") or \"+\"\n    local itemLevelDiff = \"(\"..diffColor..diffSign..diffText..\"|r)\"\n    \n    local playerLink = GetPlayerLink(player)\n    local output = \"Looted: \"..playerLink..\" \"..itemLink..\" \"..itemType..\" \"..itemLevel..\" \"..itemLevelDiff\n    print(output)\n    \n    return false\nend",
